import React from 'react';
import { withRouter, Link } from 'react-router-dom';


const BuildingList = (props) => {
    return (
      <React.Fragment>
        <div className="col-md-6 col-12">
          <div className="border shadow-sm rounded card-box mx-2 my-2">
            <div className="card__display-img">
              <img className="" src={props.building.image} style={{width:'100%'}} alt=""/>
            </div>
          </div>
        </div>
      </React.Fragment>
    )
}

export default (withRouter(BuildingList));
